import React from "react";
import { useState,useEffect } from "react";
function Twitter (){
    const [data, setData] = useState([]);

    useEffect(() => {
        fetch("data.json")
        .then(response => response.json())
        .then(jsonData => {
          setData(jsonData);
        });
    }, []);
    return (
        <div></div>
    );
}

export default Twitter;
